import React, { Component } from "react";
import { Switch, Route, BrowserRouter, Router } from "react-router-dom";
import "./App.css";
import Home from "./Components/Home";
import Login from "./Components/Login";
import Signup from './Components/views/auth/Signup';
import StaffOnboarding from './Components/views/Onboarding/Staff_onboarding';
import StaffOnboarding2 from './Components/views/Onboarding/Staff_onboarding_2';
import StaffOnboarding3 from "./Components/views/Onboarding/Staff_onboarding_3";
import StaffOnboarding_Preview from './Components/views/Onboarding/Staff_onboarding_preview';
import AdminDashboard from "./Components/views/Dashboard/AdminDashboard/AdminDashboard";
import AdminStaffs from "./Components/views/Dashboard/AdminDashboard/Admin_Staffs";
import Staffs_Details from './Components/views/Dashboard/AdminDashboard/Admin_Staffs_details';
import { renderRoutes, routes } from "./routes";

const App = ({ history }) => {
  return (
      <Router history={history}>
          {renderRoutes(routes)}
      </Router>
  );
}
export default App;
